import React from 'react';

const Sdata = [
    {
        sname:'DARK',
        imgsrc:'one.png',
        title:'Netflix original series',
        links:'https://www.google.com',
    },
    {
        sname:'Blue',
        imgsrc:'Two.png',
        title:'Netflix original series',
        links:'https://www.google.com',

    },
    {
        sname:'Holo Love',
        imgsrc:'one.png',
        title:'Netflix original series',
        links:'https://www.google.com',
    },
]
export default Sdata;
